import React from 'react';
import MiddleWeather from '../components/middleWeather';

const dailyWeather = props => {
  return (
    <React.Fragment>
    <MiddleWeather weater = {props} />
    <p>Hello</p>
    </React.Fragment>
  )
}

export default dailyWeather;
